angular.module("ins").run(["$templateCache", function($templateCache) {$templateCache.put("templates-cache/home.html","<section ui-view=\"navigation\" class=\"ins-navigation-section\"></section><section ui-view=\"content\" class=\"ins-content-section\"></section>");
$templateCache.put("templates-cache/feed/content.html","<article ng-repeat=\"post in posts\"><div class=\"ins-body\"><img ng-src=\"external/avatars/{{post.userImage}}\"/><div class=\"ins-details\"><h3>{{post.name}}</h3><p ng-bind-html=\"post.text\"></p><div ng-if=\"post.comments.length\" class=\"ins-expand\"><a ng-click=\"post.expanded = true\">expand<i class=\"icon-circle-down\"></i></a></div></div></div><div ng-show=\"post.expanded\" class=\"ins-comments\"><ul><li ng-repeat=\"comment in post.comments\"><div class=\"ins-body\"><img ng-src=\"external/avatars/{{comment.userImage}}\"/><div class=\"ins-details\"><h3>{{comment.name}}</h3><p ng-bind-html=\"comment.text\"></p></div></div></li></ul><div class=\"ins-respond\"><input/></div></div><img ng-if=\"post.image\" ng-src=\"external/posts/{{post.image}}\"/></article>");
$templateCache.put("templates-cache/feed/navigation.html","<div class=\"ins-create-post\"><input placeholder=\"What\'s on your mind\"/><div><a><i class=\"icon-camera\"></i>Add Photo</a><a><i class=\"icon-video-camera\"></i>Add Video</a><a></a></div></div><nav><ul><li class=\"ins-selected\"><a>All Posts</a></li><li><a>Photos</a></li><li><a>Videos</a></li><li class=\"ins-spacer\"></li></ul></nav>");}]);